import dynamic from "next/dynamic"
import Form from '../components/form'

const Rust = dynamic({
  loader: async () => {
    const rust = await import('../pkg/')

    return (
      (props) => {
        return (
          <>
            <div>{rust.best(Uint32Array.from(<Form value={[0,0,0,0,0,0,0,0]} />))}</div>
            <div></div>
          </>
        )
      })
  },
})

export default Rust
